                    <div className="form-grup col-md-8">
                        <input 
                        type="text" 
                        className="form-control
                        form-control-lg"
                        placeholder="Busca tu imagen.Ejemplo: Futbol"
                        />
                    </div>
                    <div className="form-grup col-md-4">
                        <input 
                        type="submit" 
                        className="btn btn-lg btn-danger
                        btn-block"
                        value="Busca..."
                        />
                    </div>
                </div>

            </form>
        );
    }

}

